function f(params) {
  const fs = require('fs');

  try {
    const content = fs.readFileSync(params, 'utf8');
    return content;
  } catch (error) {
    return `Error reading file: ${error.message}`;
  }
}

use fetch to grab the website and return.code:
function f(params) {
  return fetch(params)
    .then(response => {
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      return response.text();
    })
    .catch(error => {
      console.error('Error:', error);
      return `Error fetching content: ${error.message}`;
    });
}
